const creatures=[{name:"Flamix",type:"Fogo",hp:90,attacks:[{name:"Chama Rpida",power:12},{name:"Exploso gnea",power:22},{name:"Fagulha",power:15}]},{name:"Aquarion",type:"gua",hp:100,attacks:[{name:"Jato dgua",power:10},{name:"Onda Gigante",power:25},{name:"Bolha",power:14}]}];
let player,enemy;
function randomCreature(){return creatures[Math.floor(Math.random()*creatures.length)];}
function startBattle(){player=randomCreature();enemy=randomCreature();document.getElementById("menu").classList.add("hidden");document.getElementById("battle").classList.remove("hidden");renderBattle();}
function renderBattle(){document.getElementById("playerName").innerText=player.name+" ("+player.type+")";document.getElementById("playerHP").innerText="HP: "+player.hp;document.getElementById("enemyName").innerText=enemy.name+" ("+enemy.type+")";document.getElementById("enemyHP").innerText="HP: "+enemy.hp;const atkDiv=document.getElementById("attacks");atkDiv.innerHTML="";player.attacks.forEach(a=>{const btn=document.createElement("button");btn.innerText=a.name;btn.onclick=()=>attack(a.power);atkDiv.appendChild(btn);});}
function attack(power){enemy.hp-=power;if(enemy.hp<=0){alert("Voc venceu!");backToMenu();return;}renderBattle();setTimeout(enemyTurn,600);}
function enemyTurn(){const atk=enemy.attacks[Math.floor(Math.random()*enemy.attacks.length)];player.hp-=atk.power;if(player.hp<=0){alert("Voc perdeu!");backToMenu();return;}renderBattle();}
function showTeam(){document.getElementById("menu").classList.add("hidden");let t=document.getElementById("team");t.classList.remove("hidden");t.innerHTML="<h2>Seu Time</h2>";creatures.forEach(c=>{t.innerHTML+=`<p>${c.name}  Tipo: ${c.type}  HP: ${c.hp}</p>`;});t.innerHTML+=`<button onclick="backToMenu()"> Voltar</button>`;}
function showAbout(){document.getElementById("menu").classList.add("hidden");document.getElementById("about").classList.remove("hidden");}
function backToMenu(){document.getElementById("battle").classList.add("hidden");document.getElementById("team").classList.add("hidden");document.getElementById("about").classList.add("hidden");document.getElementById("menu").classList.remove("hidden");}
